FeedPackage.Description:
目前只支持两种日志方式
  <appSettings>
    <!--写日志的方式，可配置1文本，2数据库，仅限mongoDb,默认1-->
    <add key="WriteLogMethod" value="1,2"/>
    <!--如果是要写入数据库，需要添加以下配置信息-->
    <add key="MongoDbCon" value="mongodb://IP:27017"/>
  </appSettings>

C# Code
            写日志
            LogInfo logInfo = new LogInfo()
            {
                AppName = "appName1",
                Content = "content1",
                Type = LogType.Infomation,
                Operate = "operate1"
            };

            var demo = new WriteLog();
            demo.Run(logInfo);

           //日志查询，仅限mongoDb
            var demo = new SearchLog();
            List<LogInfo> logInfos = demo.QueryPageLogs(params)

